import './App.css';
//import Card from './components/CARD/Card.jsx';
import Cards from './components/CARDS/Cards.jsx';
// import SearchBar from './components/SEARCHBAR/SearchBar.jsx';
import characters from './data.js';
import style from './App.module.css'
import NavBar from './components/NAVBAR/navBar';


   
function App() {
   function searchHandler(){
      window.alert('El ID que estoy buscando')
   }
   function closeHandler(){
      window.alert('Emulamos que se cierra la card')

   }

   return (
      <div className='App' style={{padding:'25px'}}> 
        <img className={style.imagen} src='https://es.clippingmagic.com/images/158047225/public/downloadPreview/3ce9d5ddecf55604193673581065111bc1de0a68/descarga%20(5)_preview_rev_1.png' alt=''/>
         <div className={style.Nav}> 
         <NavBar onClick={searchHandler}></NavBar>
         </div>
         <div>
         <Cards characters={characters} onClose={closeHandler}/>
         </div>
      </div>
   );
}
 
export default App;
